exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog"),url=`http://www.paoshu8.com/${bid.idPrefix()}_${bid}/`;return parseCatalog(url,[/<dt>《[^》]+》正文<\/dt>(?<fragment>(?:\s*<dd><a[^>]*>[^<]*<\/a><\/dd>)+)/,/<a href="(?<url>[^"]+)">(?<name>[^<]+)</g],{clientOptions:{...(options&&options.clientOptions)}})};